import React from 'react';
import "./clothes.css"
import { Link } from 'react-router-dom';
import IntersectionObserverComponent from '../animation/Anime';

export const Clothes=({array})=>{


    return(
        <>
     
        <div className='cloth-globale'>
            {array.map((item,index)=>{
                return(
                    <IntersectionObserverComponent className="container">
            <div className="container" key={index}>
            
           <Link to={item.path}> <img src={item.image} alt="${index}+1"  className='image'/></Link>
         
         <Link to={item.path} className='titre'>{item.title}</Link>
         <p className="description">{item.description}</p>
         </div>
         </IntersectionObserverComponent>
            )})}

        </div>
        
        
        
        
        
        
        </>
    )
}
